import React from 'react'
import img1 from '../images/carousel/felxo-inks.jpg'
import img2 from '../images/carousel/reg-cylinder.jpg'
import img3 from '../images/carousel/pic1.jpeg'
import { Carousel } from 'react-bootstrap'
import styled from "styled-components";
const Styles = styled.div`
.carousel {

  height:320px;

  }

  .carousel-inner &gt; .item &gt; img {

  height:320px;


  object-fit: cover;

  }
`;



export const Caro = () => (
  <Styles>
  <Carousel style={{}}>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={img1}
      alt="First slide"
      style={{width:50}}
      class="d-block w-100" 
      style={{opacity:0.7}}
    />
    <Carousel.Caption style={{top:30, paddingTop:95 , color:"black"}}>
      <h3 style={{fontSize:45}}><strong>First slide label</strong></h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={img2}
      alt="Third slide"
      style={{width:50}}
      class="d-block w-100" 
      style={{opacity:0.7}}
    />

    <Carousel.Caption style={{top:30, paddingTop:95, color:"black"}}>
    <h3 style={{fontSize:45}}><strong>First slide label</strong></h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={img3}
      alt="Third slide"
      style={{width:50}}
      class="d-block w-100" 
      style={{opacity:0.6}}
    />

    <Carousel.Caption  style={{top:30, paddingTop:95,color:"black"}}>
    <h3 style={{fontSize:45}}><strong>First slide label</strong></h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
</Styles>



);
